Data::Korok *Data::KorokExists(uint32_t hash)
{
// Check if the koroks contains this one
    for (int i = 0; i < 900; i++)
    {
// Found it
        if (Koroks[i].hash == hash)
            return &Koroks[i];
    }

    return nullptr;
}

